import './Header.css';



const Header=() => {
  return (
    <div className='Header'>
        <div>
          <div class="logo"><img src='..\public\logo.png'></img>
          <div class="middle">
            <a href="" class="btn btn1">Создать анкету</a>

            </div>
          </div>
        </div>
    </div>
  );
}

export default Header;
